def get_state(pe=0, le=0, po=0, de=0):
    return '{'+f'"permeability":{pe}, "lethality":{le}, "population":{po}, "deaths":{de}'+'}'

def get_all_states(conf):
    for y in range(len(conf["perm"])):
        for x in range(len(conf["perm"][y])):
            #if conf["perm"][y][x] or conf["leth"][y][x] or conf["pop"][y][x] or conf["dead"][y][x]:
            if conf["perm"][y][x] or conf["leth"][y][x] or conf["pop"][y][x]:
                #yield '{"cell_id": ['+f'{x}, {y}'+'], "state":'+get_state(conf["perm"][y][x], conf["leth"][y][x], conf["pop"][y][x], conf["dead"][y][x])+'}'
                yield '{"cell_id": ['+f'{x}, {y}'+'], "state":'+get_state(conf["perm"][y][x], conf["leth"][y][x], conf["pop"][y][x], 0)+'}'



for conf in sources:

    with open(os.path.join(".","config",(f'{conf["name"]}.json')), "w") as file:
        print('''{
    "scenario": {
        "shape": ['''+f'{len(conf["perm"][0])}, {len(conf["perm"])}'+'''],
        "wrapped": false,
        "default_delay": "inertial",
        "default_cell_type": "samc_cell",
        "default_state":'''+f'{get_state()}'+''',
        "default_config": {},
        "neighborhood": [
          {
            "type": "von_neumann",
            "range": 1
          }
        ]
    },
    "cells": [
        '''+",\n        ".join(get_all_states(conf))+'''
    ]
}
''', file=file)

